import React,{ Component } from 'react';


//STYLES
//import '../styles/Form.css'

class Signup extends Component {


    render(){

    return (
      <div className="signup">
        <form className="user-login" > 
            <div>
            <p>Have An Account? Go To Login</p>
                <label htmlFor="username">USERNAME: </label>
                <input type="text" placeholder="ENTER USER NAME" required/>
            </div>
            <div>
            <label htmlFor="phoneno" >PHONE NO: </label>
            <input name="phoneno" type="number" placeholder="ENTER PHONE NUMBER" required/>
            </div>
            <div>
            <label htmlFor="house-address" >HOUSE ADDRESS:</label>
            <input name="house-address" type="text" placeholder="ENTER HOUSE ADDRESS"/>
            </div>
            <div>
                <label htmlFor="email">EMAIL:</label>
                <input type="email" placeholder="ENTER EMAIL" required/>
            </div>
            <div>
                <label htmlFor="password" >PASSWORD:</label>
                <input  placeholder="ENTER PASSWORD" type="password" required/>
            </div>
            <button type="submit">Create</button>
        </form>
      </div>
    );
    }
  }

  export default Signup;
